import React from "react";
import "../Input.sass";

const Checkbox = ({
  type = "",
  defaultValue = "",
  title = "",
  name = "",
  onChange = (e) => {},
  disabled = false,
  required = false,
  fullWidth = false,
  constraint = (val) => {
    return true;
  },
}) => {
  const [value, setValue] = useState(defaultValue);

  const handleValue = (e) => {
    setValue(e.target.value);
    onChange(e);
  };
  return (
    <div className={`input_ ${fullWidth ? "fullwidth" : ""}`}>
      <div className="checkbox_container"></div>
      <label htmlFor={name}>{title}</label>
    </div>
  );
};

export default Checkbox;
